import React from 'react';
import * as WebBrowser from 'expo-web-browser';
import { makeRedirectUri, useAuthRequest, useAutoDiscovery } from 'expo-auth-session';
import {Button} from 'react-native';

WebBrowser.maybeCompleteAuthSession();

export default function AuthorizationButton() {
// Endpoint
  const discovery = useAutoDiscovery('https://login.microsoftonline.com/65fa44cb-fe68-4b06-ad9f-d4343bd7589f/v2.0');
  // Request
  const [request, response, promptAsync] = useAuthRequest(
    {
      clientId: 'a67a4317-87b9-403b-8db9-e0227117bc8a',
      scopes: ['openid', 'profile', 'email', 'offline_access'],
      // For usage in managed apps using the proxy
      redirectUri: makeRedirectUri({
        // For usage in bare and standalone
        native: 'houe-plastic-recycling://react-native-auth/',
      }),
    },
    discovery
  );

  return (<Button title="Login" onPress={promptAsync} />);
}
